import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => {
  return (
    <div className="min-h-screen bg-cover bg-center" style={{ backgroundImage: 'url(/images/background.jpg)' }}>
      <div className="flex items-center justify-center h-full">
        <div className="bg-white bg-opacity-75 rounded-lg p-8">
          <h1 className="text-3xl font-bold mb-4">Welcome to Feedback Website</h1>
          <div className="flex justify-center space-x-4">
            <Link to="/feedback/anonymous" className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
              Anonymous Feedback
            </Link>
            <Link to="/feedback/public" className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
              Public Feedback
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
